import React, { Component } from 'react';
import web3 from 'web3';
import ipfs from '../components/ipfs';


export default () => {

<form onSubmit={this.onSubmit}>
  <input 
    type = "file"
    onChange = {this.captureFile}
  />
   <Button 
   bsStyle="primary" 
   type="submit"> 
   Send it 
   </Button>
</form>

}
